import React from 'react';
import '../App.css';
import './CollisionVisualizer.css';

export default class CollisionVisualizer extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            array: [],
        }
    }

    componentDidMount() {
        const array = [];

        for (let i = 0; i < 100; i++) {
            array.push(1);
        }
        this.setState({array});
    }

    render() {
        const {array} = this.state;

        return (
            <div className="collision-container">
